import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useUserData } from '../context/UserDataContext';
import { providers } from '../data/sampleData';

const ProviderResultsPage = () => {
  const navigate = useNavigate();
  const { state } = useUserData();
  const [matchedProviders, setMatchedProviders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulate API call delay
    const timer = setTimeout(() => {
      const matched = findMatchingProviders(state.userData);
      setMatchedProviders(matched);
      setLoading(false);
    }, 1500);

    return () => clearTimeout(timer);
  }, [state.userData]);

  const findMatchingProviders = (userData) => {
    // Simple matching logic based on insurance and symptoms
    const { insurance, symptoms } = userData;
    
    return providers
      .filter(provider => 
        provider.accepted_insurances.includes(insurance)
      )
      .sort((a, b) => {
        // Sort by rating first, then by wait time
        if (b.rating !== a.rating) {
          return b.rating - a.rating;
        }
        // Parse wait time (assuming format like "20 mins")
        const aWait = parseInt(a.wait_time);
        const bWait = parseInt(b.wait_time);
        return aWait - bWait;
      })
      .slice(0, 3); // Get top 3
  };

  const handleProviderSelect = (provider) => {
    navigate(`/provider/${provider.id}`);
  };

  const renderStars = (rating) => {
    const stars = [];
    const fullStars = Math.floor(rating);
    const hasHalfStar = rating % 1 !== 0;
    
    for (let i = 0; i < fullStars; i++) {
      stars.push('★');
    }
    if (hasHalfStar) {
      stars.push('☆');
    }
    for (let i = stars.length; i < 5; i++) {
      stars.push('☆');
    }
    
    return stars.join('');
  };

  if (loading) {
    return (
      <div className="container">
        <div className="card">
          <div className="loading">
            <h2>Finding the best providers for you...</h2>
            <p>Analyzing your symptoms and insurance coverage</p>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="container">
      <div className="card">
        <h1 style={{ marginBottom: '20px', color: '#333' }}>
          Top Providers for You
        </h1>
        
        <div style={{ 
          background: '#f8f9fa', 
          padding: '16px', 
          borderRadius: '8px', 
          marginBottom: '30px' 
        }}>
          <h3 style={{ marginBottom: '8px' }}>Your Search Criteria:</h3>
          <p><strong>Symptoms:</strong> {state.userData.symptoms}</p>
          <p><strong>Location:</strong> {state.userData.location}</p>
          <p><strong>Insurance:</strong> {state.userData.insurance}</p>
        </div>

        {matchedProviders.length === 0 ? (
          <div className="error">
            <h3>No providers found</h3>
            <p>We couldn't find any providers matching your criteria. Please try adjusting your search.</p>
            <button 
              className="btn btn-primary" 
              onClick={() => navigate('/intake')}
              style={{ marginTop: '16px' }}
            >
              Modify Search
            </button>
          </div>
        ) : (
          <div>
            <p style={{ marginBottom: '20px', color: '#666' }}>
              We found {matchedProviders.length} providers that match your needs:
            </p>
            
            {matchedProviders.map((provider, index) => (
              <div key={provider.id} className="provider-card">
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                  <div style={{ flex: '1' }}>
                    <h3 style={{ marginBottom: '8px', color: '#333' }}>
                      {index + 1}. {provider.name}
                    </h3>
                    <p style={{ color: '#666', marginBottom: '8px' }}>
                      <strong>{provider.specialty}</strong>
                    </p>
                    <p style={{ color: '#666', marginBottom: '8px' }}>
                      📍 {provider.address}
                    </p>
                    <div style={{ display: 'flex', gap: '20px', marginBottom: '12px' }}>
                      <span className="rating">
                        {renderStars(provider.rating)} {provider.rating}
                      </span>
                      <span>⏱️ {provider.wait_time} wait</span>
                    </div>
                    <p style={{ color: '#666', fontSize: '0.9rem' }}>
                      Accepts: {provider.accepted_insurances.join(', ')}
                    </p>
                  </div>
                  <button
                    className="btn btn-primary"
                    onClick={() => handleProviderSelect(provider)}
                  >
                    View Details
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}

        <div style={{ display: 'flex', gap: '16px', marginTop: '30px' }}>
          <button
            className="btn btn-secondary"
            onClick={() => navigate('/intake')}
          >
            Back to Search
          </button>
        </div>
      </div>
    </div>
  );
};

export default ProviderResultsPage;
